/* get the dir separator */
Local PSXP_RPTDEFNMANAGER:Utility &o_Utility = create PSXP_RPTDEFNMANAGER:Utility();

Local string &Str_DirSep = &o_Utility.GetDirSeparator();

Local string &Str_filelocation = GetRecord().FILE_PATH_NAME.Value;

If Len(&Str_filelocation) > 5 Then

   If Substring(&Str_filelocation, Len(&Str_filelocation), 1) <> &Str_DirSep Then
      &Str_filelocation = &Str_filelocation | &Str_DirSep;
   End-If;

   /* Upload an attachment - Move to File Server */
   /* get the file from the user - put in DB Table */
   &retCode = AddAttachment(URL.FILEDB, &ATTACHSYSFILENAME, "", &attachuserfile, 0, False);

   If &retCode = 0 Then
      /* gen the server location as per the current directory */
      &DestinationFullURL = &Str_filelocation | &attachuserfile;

      /* send to file server from the db */
      &nReturn = GetAttachment(URL.FILEDB, &attachuserfile, &DestinationFullURL);

      /* delete the file from the db table */
      &nReturn = DeleteAttachment(URL.FILEDB, &attachuserfile);

      /* refresh the grid with the new file */
      Local X_LOGFILE_UTIL:X_RefreshGrid &o_XRefresh = create X_LOGFILE_UTIL:X_RefreshGrid(GetLevel0()(1).GetRowset(Scroll.X_DIRECT2_WRK), GetLevel0()(1).GetRecord(Record.X_DIRECT1_WRK));

      &o_XRefresh.Refresh();
   End-If;

Else

   MessageBox(0, "", 0, 0, "Not a good place to upload a file: %1", &Str_filelocation);

End-If;

