import X_LOGFILE_UTIL:X_LogFile_Finder;

class X_RefreshGrid
   method X_RefreshGrid(&InRSTarget As Rowset, &InRecControlRec As Record);
   method Refresh();

private

   instance string &initialFilePath;
   instance Rowset &TargetDisplayRS;
   instance Field &Fld_X_INC_SUBDIRS;

end-class;

method X_RefreshGrid
   /+ &InRSTarget as Rowset, +/
   /+ &InRecControlRec as Record +/

   &initialFilePath = X_DIRECT1_WRK.FILE_PATH_NAME;
   &TargetDisplayRS = &InRSTarget;
   &Fld_X_INC_SUBDIRS = &InRecControlRec.GetField(Field.X_INC_SUBDIRS);

end-method;


method Refresh

   Local X_LOGFILE_UTIL:X_LogFile_Finder &o_LogfileFinder = create X_LOGFILE_UTIL:X_LogFile_Finder();

   Local string &realArchiveFilePath;
   Local integer &i;

   /* return where the directory really is in the doc repository file shares */
   &realArchiveFilePath = &o_LogfileFinder.FindArchivePath(&initialFilePath);

   &TargetDisplayRS.Flush();

   If &Fld_X_INC_SUBDIRS.Value = "Y" Then
      &o_LogfileFinder.File_List_Recursive.CopyTo(&TargetDisplayRS);
   Else
      &o_LogfileFinder.File_List_local.CopyTo(&TargetDisplayRS);
   End-If;

   &TargetDisplayRS.Sort(X_DIRECTORY.FILE_NAME, "A");
   &TargetDisplayRS.ShowAllRows();

   /* loop through and setup the rowset */
   For &i = 1 To &TargetDisplayRS.ActiveRowCount

      If None(&TargetDisplayRS(&i).X_DIRECTORY.FILE_PATH_NAME.Value) Then
         &TargetDisplayRS(&i).X_DIRECTORY.DELETE_PB.Visible = False;
         &TargetDisplayRS(&i).X_DIRECTORY.VIEW_ATTACH_LNK.LabelImage = Image.EOPP_SCTREE_END_NODE;
         &TargetDisplayRS(&i).X_DIRECTORY.VIEW_ATTACH_LNK.Enabled = False;

      Else

         If None(&TargetDisplayRS(&i).X_DIRECTORY.FILE_NAME.Value) Then

            &TargetDisplayRS(&i).X_DIRECTORY.VIEW_ATTACH_LNK.LabelImage = Image.EOPP_FN_LARGE_FOLDER_ICN;
            &TargetDisplayRS(&i).X_DIRECTORY.DELETE_PB.Visible = False;
         Else
            &TargetDisplayRS(&i).X_DIRECTORY.VIEW_ATTACH_LNK.LabelImage = Image.PS_PERSON_PROFILE_M_FL;
         End-If;

      End-If;
   End-For;

end-method;
